class Solution:
    def minAreaRect(self, points):
        minArea = float('inf')
        xpoints = {}
        ypoints = {}
        for i, point in enumerate(points):
            if point[1] in xpoints:
                xpoints[point[1]].add(i)
            else:
                xpoints[point[1]] = {i}
            if point[0] in ypoints:
                ypoints[point[0]].add(i)
            else:
                ypoints[point[0]] = {i}
        xpoints = [(x, c) for x, c in xpoints.items() if len(c) >= 2]
        ypoints = [(y, c) for y, c in ypoints.items() if len(c) >= 2]
        xlen = len(xpoints)
        ylen = len(ypoints)
        for xa in range(xlen):
            for xb in range(xa + 1, xlen):
                xp = xpoints[xa][1].union(xpoints[xb][1])
                for ya in range(ylen):
                    for yb in range(ya + 1, ylen):
                        yp = ypoints[ya][1].union(ypoints[yb][1])
                        common = xp.intersection(yp)
                        if len(common) == 4:
                            minArea = min(minArea, abs(xpoints[xa][0] - xpoints[xb][0]) * abs(ypoints[ya][0] - ypoints[yb][0]))
        return 0 if minArea == float('inf') else minArea

